import React from "react";
import background from "../images/background.png";
function Home() {
  return (
    <div className="relative">
      <img
        src={background}
        alt=""
        className="w-full h-screen transform absolute z-0"
      />
      <div className="relative z-20 text-custom-blue"></div>
    </div>
  );
}

export default Home;
